package com.example.entity;import com.example.entity.Base.StringBaseEntity;import com.fasterxml.jackson.annotation.JsonInclude;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;@Setter@Getter@JsonInclude(JsonInclude.Include.NON_NULL)@Entity@Table(name = "video_watched")public class VideoWatched extends StringBaseEntity {    @Column(name = "profile_id")    private Integer profileId;    @ManyToOne    @JoinColumn(name = "profile_id", insertable = false, updatable = false)    private ProfileEntity profileEntity;    @Column(name = "video_id")    private String videoId;    @ManyToOne    @JoinColumn(name = "video_id", insertable = false, updatable = false)    private VideoEntity videoEntity;}